 /* 创建表结构 `ms_cart` */
 DROP TABLE IF EXISTS `ms_cart`;/* MySQLReback Separation */ CREATE TABLE `ms_cart` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `goods_id` int(11) NOT NULL,
  `create_time` varchar(255) DEFAULT NULL COMMENT '添加时间',
  `num` int(11) NOT NULL DEFAULT '1' COMMENT '商品数量',
  `status` tinyint(1) DEFAULT '1' COMMENT '1正常2删除',
