 /* 创建表结构 `ms_center_address` */
 DROP TABLE IF EXISTS `ms_center_address`;/* MySQLReback Separation */ CREATE TABLE `ms_center_address` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `province` int(11) DEFAULT NULL COMMENT '省',
  `city` int(11) DEFAULT NULL COMMENT '市',
  `area` int(11) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `create_time` int(11) DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) DEFAULT '0' COMMENT '更新时间',
  `status` tinyint(1) DEFAULT '0' COMMENT '0未审核 1，已审核通过 2，已审核驳回',
  `center_level` int(1) DEFAULT '1' COMMENT '连锁店等级 1连锁店 2运营中心 3市级公司 4省级公司',
  `is_push_shop` tinyint(1) DEFAULT '0' COMMENT '是否发放推荐奖   0未发放 1已发放',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3004 DEFAULT CHARSET=utf8 COMMENT='连锁店申请表';/* MySQLReback Separation */
