  `cha_004` decimal(50,4) DEFAULT '0.0000',
  `cha_005` decimal(50,4) DEFAULT '0.0000',
  `cha_006` decimal(50,4) DEFAULT '0.0000',
  `cha_007` decimal(50,4) DEFAULT '0.0000',
  `cha_008` decimal(50,4) DEFAULT '0.0000',
  `cha_009` decimal(50,4) DEFAULT '0.0000',
  `cha_010` decimal(50,4) DEFAULT '0.0000',
