  `owner` varchar(100) DEFAULT '' COMMENT '拥有者',
  `cha_date` int(30) unsigned DEFAULT NULL COMMENT '日期',
  `cha_011` decimal(50,4) unsigned zerofill DEFAULT '0000000000000000000000000000000000000000000000.0000',
