 DROP TABLE IF EXISTS `ms_goods_class`;/* MySQLReback Separation */ CREATE TABLE `ms_goods_class` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '分类名称',
  `status` tinyint(1) DEFAULT '1' COMMENT '启用状态1启用2禁用',
  `sort` smallint(6) DEFAULT NULL COMMENT '展示顺序',
  `is_home` tinyint(1) DEFAULT '1' COMMENT '是否推荐到首页1是2否',
  `belong` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=22 DEFAULT CHARSET=utf8;/* MySQLReback Separation */
