 INSERT INTO `ms_news` VALUES ('11','关于我们','<section><section><section><section><section><section><section><section><section><section><p style=\"margin-left: 48px; text-align: justify;\"><span style=\"font-size: 14px;\"><span style=\"font-family:Arial\"></span></span></p><p><span style=\"font-family:宋体\">&nbsp; &nbsp; <strong>GHA全球健康联盟</strong>, 志在打造人居健康第一平台. 背后依托塞尔维亚国际股权数据化交易中心,新加坡旁.森林城市,广州天来宝集团科技有限公司,新天来宝集团,辣木养生谷,五大项目. 可以说是&quot;0&quot;风险.</span></p><p><span style=\"font-family:宋体\">&nbsp; &nbsp; 健康是未来世界的大趋势,GHA全球健康联盟,就是抓住机会,旨在做大做强. 让全民都参与进来,共同分享世界&quot;健康&quot;事业的一杯羹. GHA全球健康联盟,由国际化专业团队经营,五大项目作为依托背景. 让所有合伙人放心,安心.参与GHA, 就是在创业,就是在做最安稳的合伙人!&nbsp;</span></p><p><span style=\"font-family:宋体\">&nbsp; &nbsp; <strong>GHA全球健康联盟,必将颠覆全球健康事业.</strong></span></p></section></section></section></section></section></section></section></section></section></section>','1','1551425088','1'),('13','联系我们','','1','1551517444','2'),('16','公司新闻','','1','1541479084','2'),('15','公司招聘','','1','1541479074','2');/* MySQLReback Separation */
