 /* 创建表结构 `ms_order` */
 DROP TABLE IF EXISTS `ms_order`;/* MySQLReback Separation */ CREATE TABLE `ms_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(255) NOT NULL COMMENT '订单id',
  `goods_id` varchar(255) DEFAULT NULL COMMENT '商品id',
  `user_id` int(11) NOT NULL COMMENT '买家id',
  `shop_id` int(11) DEFAULT NULL COMMENT '商家id（社区站直营站等）',
  `type` tinyint(1) DEFAULT NULL COMMENT '交易方式(1自提2邮寄)',
  `pv_amount` decimal(10,2) DEFAULT '0.00',
  `amount` decimal(15,2) DEFAULT '0.00' COMMENT '订单总额',
  `pay_amount` decimal(15,2) DEFAULT '0.00' COMMENT '实际支付金额',
  `num` varchar(255) DEFAULT '1' COMMENT '商品数量',
  `status` smallint(1) NOT NULL DEFAULT '1' COMMENT '订单状态1待付款2已付款',
  `create_time` int(11) NOT NULL COMMENT '订单创建时间',
  `is_reg` tinyint(255) DEFAULT '2' COMMENT '1是2不是',
  `order_type` tinyint(1) DEFAULT '2' COMMENT '1注册单2零售单',
  `wuliu` varchar(255) DEFAULT NULL,
  `wuliu_company` varchar(255) DEFAULT NULL COMMENT '物流公司',
  `wuliu_status` tinyint(4) DEFAULT '4' COMMENT '发货状态4未发货5已发货6确认收货',
  `address` varchar(255) DEFAULT NULL COMMENT '收货地址',
  `receiver` varchar(255) DEFAULT NULL COMMENT '收货人',
  `phone` varchar(255) DEFAULT NULL COMMENT '联系方式',
  `is_sub` tinyint(1) DEFAULT '1' COMMENT '是否有子订单1没有2有',
  `zhen` int(11) DEFAULT NULL,
  `xian` int(11) DEFAULT NULL,
  `shi` int(11) DEFAULT NULL,
  `sheng` int(11) DEFAULT NULL,
  `zhen_` int(11) DEFAULT NULL COMMENT '店铺代理',
  `xian_` int(11) DEFAULT NULL,
  `shi_` int(11) DEFAULT NULL,
  `sheng_` int(11) DEFAULT NULL,
  `zhen_1` int(11) DEFAULT NULL COMMENT '省市区id',
  `xian_1` int(255) DEFAULT NULL,
  `shi_1` int(255) DEFAULT NULL,
  `sheng_1` int(11) DEFAULT NULL,
  `zhen_2` int(11) DEFAULT NULL,
  `xian_2` int(11) DEFAULT NULL,
  `shi_2` int(11) DEFAULT NULL,
  `sheng_2` int(11) DEFAULT NULL,
  `daili_1` int(11) DEFAULT '0',
  `daili_2` int(11) DEFAULT NULL,
  `recharge_id` int(11) DEFAULT NULL,
  `pay_type` tinyint(1) DEFAULT '0' COMMENT '支付方式 1现金余额 2提现积分 3购物积分 4兑换积分',
  `time_end` varchar(255) DEFAULT '' COMMENT '支付成功时间',
  `is_first` tinyint(1) DEFAULT '0' COMMENT '是否是首单 1是，0不是',
  `is_update` tinyint(1) DEFAULT '0' COMMENT '是否升级单 0否 1是',
  `up_level` int(1) DEFAULT '0' COMMENT '可升至等级 1会员 2经销商 3代理商 4合伙人',
  `module` smallint(1) NOT NULL DEFAULT '1' COMMENT '商品所属模块 1会员商城 2重复消费商城 3兑换商城 4商学院 5保险 6金融 ',
  `send_shop_id` int(11) DEFAULT '0' COMMENT '发货店铺名，0代表平台',
  `is_sign` tinyint(1) DEFAULT '0' COMMENT '标记品台是否已发送给连锁店 0不是，1是',
  `is_from_sign` tinyint(1) DEFAULT '0' COMMENT '标记品台是否连锁店购买 0不是，1是',
  `is_recomd` tinyint(1) DEFAULT '0' COMMENT '是否发放推荐奖 0未，1已发',
  `is_td` tinyint(1) DEFAULT '0' COMMENT '是否发放团队奖励 0未，1已发',
  `is_js` tinyint(1) DEFAULT '0' COMMENT '是否发放加速奖励 0未，1已发',
  `is_up` tinyint(1) DEFAULT '0' COMMENT '是否发放升级奖 0未，1已发',
